INSERT INTO patient_reports VALUES(1,8,replace('# **Physiotherapy Treatment Progress Report**  \n**Patient Name:** Filip De Wilde  \n**Diagnosis:** Left Clavicular Fracture Rehabilitation  \n**Treatment Duration:** 2 months, 3 weeks (21 sessions)  \n**Report Date:** 2025-04-10  \n\n---\n\n## **1. PATIENT OVERVIEW**  \nMr. Filip De Wilde presented with a left clavicular fracture requiring rehabilitation to restore shoulder mobility and function. Initial goals focused on improving **range of motion (ROM)** in **flexion, abduction, external rotation (ER), and internal rotation (IR)** while managing pain and muscle tension.  \n\n---\n\n## **2. CLINICAL ASSESSMENT**  \n\n### **Initial Findings (Session 1 - 2025-01-13)**  \n- **Pain:** Minimal (1/10)  \n- **ROM Limitations:**  \n  - **Flexion:** 75¬∞ (AROM), >90¬∞ (PROM with resistance)  \n  - **Extension:** 25¬∞  \n  - **External Rotation (ER):** 15¬∞  \n  - **Internal Rotation (IR):** 35¬∞  \n  - **Abduction (ABD):** 90¬∞  \n- **Trigger Points:** Active in pectoral major, trapezius, and infraespinatus.  \n- **Functional Limitations:** Difficulty with overhead movements and ER.  \n\n### **Key Impairments**  \n- **Restricted GH joint mobility** (especially ER and flexion).  \n- **Muscle tightness** (pectoral major, trapezius, infraespinatus).  \n- **Scapular dyskinesia** (reduced scapulohumeral rhythm).  \n\n---\n\n## **3. TREATMENT APPROACH**  \n\n### **Interventions Applied**  \n- **Manual Therapy:**  \n  - Joint mobilizations (AP glides, flexion/ER progressions).  \n  - Soft tissue release (pectoral major, trapezius, infraespinatus).  \n  - Trigger point therapy & massage gun.  \n- **Therapeutic Exercise:**  \n  - Kabat diagonals (PNF patterns).  \n  - Scapular stabilization (push-up plus, serratus activation).  \n  - Progressive resistance training (2‚Äì3.5 kg for ER/biceps).  \n- **Modalities:**  \n  - TENS for pain modulation.  \n  - Corticosteroid injection (Session 18) for persistent stiffness.  \n\n### **Progression Over Time**  \n- **Flexion ROM:** 75¬∞ ‚Üí **168¬∞** (near-full recovery).  \n- **ER ROM:** 15¬∞ ‚Üí **75¬∞** (significant improvement).  \n- **Pain:** Fluctuated (1 ‚Üí **6/10** post-injection, likely due to increased activity).  \n\n---\n\n## **4. PROGRESS EVALUATION**  \n\n### **Key Improvements**  \n- **Functional Gains:**  \n  - Resumed **tennis (3 hours)** with minimal discomfort (Session 8).  \n  - Achieved **weight-bearing exercises** (push-up plus, scapular drills).  \n- **ROM Milestones:**  \n  - Flexion improved by **93¬∞** (75¬∞ ‚Üí 168¬∞).  \n  - ER improved by **60¬∞** (15¬∞ ‚Üí 75¬∞).  \n\n### **Persistent Challenges**  \n- **ER at 90¬∞ abduction** remains restricted.  \n- **Pain spikes** (6/10 in Session 21) possibly due to increased loading.  \n\n---\n\n## **5. CURRENT STATUS**  \n- **ROM (Final Session):**  \n  - Flexion: **168¬∞**  \n  - ER: **75¬∞**  \n- **Pain:** **6/10** (localized to posterior shoulder/triceps).  \n- **Self-Management:** Adherent to HEP (2kg resistance, daily circuits).  \n\n---\n\n## **6. RECOMMENDATIONS**  \n\n### **Further Treatment**  \n- **1‚Äì2 sessions/week** for ER/IR mobilization and scapular control.  \n- **Dry needling** for persistent trigger points (PVL/QL).  \n\n### **Home Program**  \n- **Strengthening:**  \n  - ER/IR with resistance bands (3 sets √ó 12 reps).  \n  - Scapular push-up plus (2 sets √ó 10 reps).  \n- **Flexibility:**  \n  - Pectoral doorway stretches (30 sec hold, 3x/day).  \n  - Sleeper stretch for posterior capsule.  \n\n### **Activity Modification**  \n- **Avoid overhead lifting** until ER >80¬∞.  \n- **Tennis:** Limit to **1‚Äì2 hours/session** with pre-match warm-up.  \n\n---\n\n## **7. PROGNOSIS**  \n- **Expected Full Recovery:** **6‚Äì8 weeks** with consistent HEP.  \n- **Factors Influencing Recovery:**  \n  - Adherence to scapular stabilization.  \n  - Pain management during loading.  \n- **Long-Term Outlook:** Excellent for return to sport with maintained mobility.  \n\n---  \n\n**Haim Ganancia, Physiotherapist**  \nICPFA 7595 Clinic  \nReport Date: 2025-04-10','\n',char(10)),'2025-04-14 01:32:47.618148','AI Generated');
INSERT INTO patient_reports VALUES(2,5,replace('# PHYSIOTHERAPY TREATMENT PROGRESS REPORT  \n\n## 1. PATIENT OVERVIEW  \nThe patient presents with **bilateral carpal tunnel syndrome (left > right)** and **low-grade osteoarthritis** affecting multiple joints (radiocarpal, triscaphe, and 1st CMC joints). Initial assessment revealed **asymmetrical grip strength** (L:10kg, R:24kg) and muscular tightness in the left tibialis anterior. Over three treatment sessions spanning 2 weeks and 3 days, pain levels remained stable at 1/10, but grip strength declined (L:6kg, R:20kg by Session 2), prompting referral for cervical MRI to rule out radiculopathy.  \n\n---\n\n## 2. CLINICAL ASSESSMENT  \n### **Initial Findings (31/01/2025):**  \n- **Musculoskeletal:**  \n  - Osteoarthritic changes in radiocarpal, triscaphe, and 1st CMC joints (imaging-confirmed)  \n  - Left tibialis anterior and trapezius tightness  \n  - Bilateral forearm trigger points (active)  \n- **Neurological:**  \n  - Median nerve involvement (nerve gliding exercises prescribed)  \n  - Positive Eden & Wright test (left) by Session 3 (suggesting thoracic outlet component)  \n- **Functional:**  \n  - Grip strength deficit (L:10kg vs. R:24kg)  \n\n### **Key Impairments:**  \n- Declining grip strength (unresponsive to initial interventions)  \n- Persistent left tibialis anterior discomfort  \n- Multiple active trigger points (traps, glutes, forearms)  \n\n---\n\n## 3. TREATMENT APPROACH  \n### **Interventions:**  \n1. **Manual Therapy:**  \n   - Soft tissue mobilization (trapezius, glutes, tibialis anterior, epicondylar regions)  \n   - Trigger point release (bilateral forearms, elevators, quadratus lumborum)  \n2. **Neuromuscular Re-education:**  \n   - Median nerve gliding exercises  \n3. **Diagnostic Collaboration:**  \n   - Cervical MRI requested (Session 2) to assess for cervical radiculopathy contributing to grip decline  \n\n### **Progression:**  \n- Focus shifted from isolated wrist OA management to broader neuromuscular assessment due to unexplained strength loss.  \n\n---\n\n## 4. PROGRESS EVALUATION  \n| **Metric**          | **Initial**       | **Current**       | **Change**        |  \n|----------------------|-------------------|-------------------|-------------------|  \n| Pain (VAS)           | 1/10              | 1/10              | Stable            |  \n| Grip Strength (kg)   | L:10, R:24        | L:6, R:20         | Worsened          |  \n| Functional Use       | No restrictions   | No restrictions   | Stable            |  \n\n**Notable Responses:**  \n- Trigger point therapy provided transient relief but did not resolve strength deficits.  \n- Nerve gliding exercises maintained pain stability but did not improve function.  \n\n---\n\n## 5. CURRENT STATUS  \n- **Remaining Impairments:**  \n  - Unexplained grip strength loss (differential: cervical radiculopathy, advanced CTS)  \n  - Left tibialis anterior tightness  \n  - Active trigger points (traps, glutes)  \n- **Self-Management:**  \n  - Independent with nerve glides; requires supervision for strength training.  \n\n---\n\n## 6. RECOMMENDATIONS  \n1. **Further Diagnostics:**  \n   - Await cervical MRI results to guide targeted intervention.  \n2. **Home Program:**  \n   - **Nerve Mobility:** Continue median nerve glides (3x/day).  \n   - **Strength:** Graded grip strengthening (putty exercises) pending MRI findings.  \n   - **Ergonomics:** Wrist splints for nocturnal CTS symptoms.  \n3. **Prevention:**  \n   - Activity pacing to avoid overloading 1st CMC joint.  \n\n---\n\n## 7. PROGNOSIS  \n- **Short-Term:** Guarded pending MRI results. Strength recovery timeline depends on underlying etiology.  \n- **Long-Term:** Osteoarthritis management will require ongoing joint protection strategies.  \n\n---  \n\n**Haim Ganancia, Physiotherapist**  \nICPFA 7595  \nReport Date: 2025-02-17','\n',char(10)),'2025-04-14 21:50:45.927592','AI Generated');
INSERT INTO patient_reports VALUES(4,23,replace('# Physiotherapy Treatment Progress Report  \n\n## **1. PATIENT OVERVIEW**  \nThe patient presents with **medial epicondylitis ("golfer''s elbow")**, characterized by pain at the medial epicondyle and functional deficits in grip strength and forearm pronation/supination. The primary treatment goals were **pain reduction** and **strength improvement** over three sessions spanning 2 weeks and 3 days.  \n\n---  \n\n## **2. CLINICAL ASSESSMENT**  \n### **Initial Findings (Session 1: 2025-03-24)**  \n- **Pain Level**: 1/10 (mild discomfort).  \n- **Strength Measurements**:  \n  - Right grip: 53 (pressure units).  \n  - Left grip: 60 (pressure units).  \n- **Trigger Points**: Active (5/10 intensity) in unspecified forearm flexors.  \n- **Functional Limitations**: None reported, but potential weakness in repetitive gripping tasks.  \n\n### **Key Impairments**  \n- Tenderness at medial epicondyle (worsened to 3/10 by Session 3).  \n- Asymmetric grip strength (right weaker than left).  \n- Active trigger points in flexor carpi ulnaris, biceps brachii, and pronator teres.  \n\n---  \n\n## **3. TREATMENT APPROACH**  \n### **Interventions**  \n1. **Session 1**:  \n   - **Blood Flow Restriction (BFR) training** (250 mmHg) to improve strength without exacerbating pain.  \n   - Trigger point release for active points.  \n\n2. **Session 2**:  \n   - **Manual therapy**: Focused on flexor carpi ulnaris, biceps brachii, and pronator teres.  \n   - **BFR** continued (250 mmHg) with supination exercises (175¬∞ target).  \n\n3. **Session 3**:  \n   - **Interferential current therapy** (40 Hz, 29 Hz, 1 Hz, 1:1 ratio for 15 minutes) for pain modulation.  \n   - **Trigger point release**: Biceps brachii and pronator teres.  \n\n### **Progression**  \n- Grip strength fluctuated (right: 53 ‚Üí 53.3 ‚Üí 54.7; left: 60 ‚Üí 55.5 ‚Üí 48.9), suggesting possible fatigue or technique adjustments.  \n- Pain increased to 3/10 by Session 3, likely due to palpation sensitivity at the medial epicondyle.  \n\n---  \n\n## **4. PROGRESS EVALUATION**  \n- **Pain**: Increased from 1/10 to 3/10 (epicondyle palpation).  \n- **Functional Improvement**:  \n  - Supination range maintained (175¬∞).  \n  - Trigger point intensity unchanged (5/10).  \n- **Modality Response**: Interferential current provided temporary pain relief post-treatment.  \n\n---  \n\n## **5. CURRENT STATUS**  \n- **Remaining Impairments**:  \n  - Persistent medial epicondyle tenderness.  \n  - Asymmetric grip strength (right still weaker).  \n- **Self-Management**: Patient may benefit from education on activity pacing and ergonomic modifications.  \n\n---  \n\n## **6. RECOMMENDATIONS**  \n1. **Further Treatment**:  \n   - Continue BFR and manual therapy for strength balance.  \n   - Ultrasound or laser therapy for epicondyle pain.  \n2. **Home Program**:  \n   - Eccentric wrist flexor strengthening.  \n   - Ice massage for pain control.  \n3. **Activity Modifications**:  \n   - Avoid repetitive gripping/flexion.  \n   - Use ergonomic tools (e.g., padded grips).  \n4. **Prevention**:  \n   - Warm-up forearm flexors before activity.  \n   - Strengthen scapular stabilizers to reduce elbow load.  \n\n---  \n\n## **7. PROGNOSIS**  \n- **Expected Recovery**: 4‚Äì6 weeks with consistent treatment.  \n- **Influencing Factors**: Adherence to home exercises, activity modification.  \n- **Long-Term Outlook**: Good if strength imbalances are addressed.  \n\n---  \n\n**Haim Ganancia, Physiotherapist**  \nICPFA 7595  \nReport Date: 2025-04-10','\n',char(10)),'2025-05-01 16:25:14.181866','AI Generated');
INSERT INTO patient_reports VALUES(5,23,replace('### **1. Estiramiento de Flexores de Mu√±eca**  \n- **Sets & Reps:** 3 sets de 10 repeticiones  \n- **Frecuencia:** Diario  \n- **Tiempo de Sost√©n:** 5 segundos  \n- **Indicaciones Clave:**  \n  - Extiende el brazo afectado con la palma hacia arriba.  \n  - Usa la mano contraria para estirar suavemente los dedos hacia atr√°s hasta sentir tensi√≥n (sin dolor).  \n\n### **2. Flexi√≥n Isom√©trica de Mu√±eca**  \n- **Sets & Reps:** 3 sets de 5 repeticiones  \n- **Frecuencia:** 3 veces por semana  \n- **Tiempo de Sost√©n:** 10 segundos  \n- **Indicaciones Clave:**  \n  - Apoya el antebrazo en una mesa con la palma hacia arriba.  \n  - Presiona la mano contra una superficie fija (como una pared) sin mover la mu√±eca.  \n\n### **3. Pronaci√≥n/Supinaci√≥n con Pesas Ligeras**  \n- **Sets & Reps:** 2 sets de 12 repeticiones (alternando movimientos)  \n- **Frecuencia:** 3 veces por semana  \n- **Indicaciones Clave:**  \n  - Sujeta una pesa ligera (1-2 kg) con el codo doblado a 90¬∞.  \n  - Gira lentamente la palma hacia arriba (supinaci√≥n) y hacia abajo (pronaci√≥n).  \n\n### **4. Auto-Masaje con Pelota en Flexores**  \n- **Sets & Reps:** 1 minuto por zona  \n- **Frecuencia:** Diario  \n- **Indicaciones Clave:**  \n  - Rueda una pelota peque√±a/firme sobre el antebrazo (zona flexora) con presi√≥n moderada.  \n  - Evita huesos o zonas dolorosas agudas.  \n\n### **5. Extensi√≥n de Mu√±eca Exc√©ntrica**  \n- **Sets & Reps:** 3 sets de 8 repeticiones  \n- **Frecuencia:** 3 veces por semana  \n- **Indicaciones Clave:**  \n  - Sujeta una pesa ligera (1 kg) con la palma hacia abajo.  \n  - Levanta la mu√±eca con ayuda de la otra mano y baja lentamente (control exc√©ntrico).','\n',char(10)),'2025-05-01 16:30:45.392640','Exercise Homework');
